import Vue from 'vue'
import App from './App.vue'//'.'代表当前目录
import router from './router/index.js'//index.js可以简/不写

Vue.config.productionTip = false
//创建Vue对象
new Vue({
  router,//注册导入的路由对象
  render: h => h(App)//渲染页面
}).$mount('#app')
